css:
@namespace url(http://www.w3.org/1999/xhtml);
/*Washington Post Title*/

@font-face {
    font-family: "PostoniWide";
    font-style: normal;
    font-weight: bold;
    src: url("data:application/font-woff;base64,");
}
@font-face {
    font-family: 'Alike Angular';
    font-style: normal;
    font-weight: 400;
    src: local('Alike Angular'), local('AlikeAngular-Regular'), url(https://fonts.gstatic.com/s/alikeangular/v6/OpeCu4xxI3qO1C7CZcJtPb6iX381CwN1C9yEk5y0JLs.woff) format('woff');
}

@-moz-document domain("inoreader.com") {
*::-moz-selection {
    background: #b4e7f8;
}
h1,
h2,
h3,
h4,
h5 {
    display: none
}
.article_content {
    text-shadow: 1px 1px 1px rgba(0, 0, 0, 0.001) !important;
    display: block !important;
    color: black !important;
    text-rendering: optimizeLegibility !important;
    font-size: 16px;
    font-family: Helvetica, Arial, "PingFang SC", "Microsoft YaHei", "WenQuanYi Micro Hei", "tohoma,sans-serif";
    line-height: -moz-calc(1.3em + (1.5 - 1.3) * ((100vw - 21em)/(35 - 21))) !important;
    max-width: 80% !important;
    text-align: justify;
    margin-left: auto;
    margin-right: auto;
    width: 80%;
}
.article_content a {
    color: black !important;
    text-decoration: none !important;
    border-bottom: 3px solid #b4e7f8;
    box-shadow: inset 0 -4px 0 #b4e7f8;
    -moz-transition: background .15s cubic-bezier(.33, .66, .66, 1);
}
.article_content a:hover {
    background: #b4e7f8
}
.article_content img,
.article_content iframe {
    display: block !important;
    margin: 0 auto !important;
    max-width: 95% !important;
    margin-right: auto;
    margin-left: auto;
    text-align: center;
    border-color: #e1e1e1;
    border-style: solid;
    border-width: 1px;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    padding: 0.15em;
}
.article_card .article_title,
#article_dialog .article_title {
    padding-right: 0px;
}
.article_title {
    font-size: 22px;
    font-family: Helvetica, Arial, "PingFang SC", "Microsoft YaHei", "WenQuanYi Micro Hei", "tohoma,sans-serif";
    display: block !important;
    text-align: center !important;
    justify-content: center;
}
.article_sub_title {
    height: 40px;
    display: flex;
    justify-content: center;
}
blockquote {
    background: #f9f9f9;
    border-left: 7px solid #ccc;
    margin: 1.5em 10px;
    padding: 0.5em 10px;
    quotes: "\201C""\201D""\2018""\2019";
}
blockquote:before {
    color: #ccc;
    content: open-quote;
    font-size: 4em;
    line-height: 0.1em;
    margin-right: 0.25em;
    vertical-align: -0.4em;
}
blockquote p {
    display: inline;
}
.article_content img {
    border-color: #e1e1e1;
    border-style: solid;
    border-width: 1px;
    box-sizing: border-box;
    height: auto !important;
    max-width: 98% !important;
    padding: 0.15em;
    display: block !important;
    margin-left: auto !important;
    margin-right: auto !important;
    margin-bottom: 2.5em !important;
    overflow: hidden !important;
}
#sb_rp_upgrade,
#sb_rp_section_options,
.ad_footer_remove,
.inno_toolbar_button_upgrade {
    display: none;
}
#sb_rp_gear {
    right: 0px!important;
}
#sb_rp_notifications {
    right: calc(114px - 74px)!important;
}
#sb_rp_tools {
    right: calc(152px - 74px)!important;
}
#wraper {
    min-width: calc(930px - 120px - 74px)!important;
}
#subscriptions_nav {
    padding-top: 0 !important;
}
#tree_pane span.unread_cnt,
#tree_pane span.icon-checkmark {
    color: #D24231 !important;
}
#tree_pane #tree {
    padding-bottom: 30px !important;
}
#reader_pane.reader_pane_sinner {
    padding-right: 0px;
}
#reader_pane.reader_pane_view_style_0 > #consent_https_info {
    padding-top: 6px !important;
    padding-bottom: 6px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar {
    margin-top: 2px !important;
    margin-bottom: 2px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar div.article_header > div {
    padding-top: 6px !important;
    padding-bottom: 6px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar div.article_header > div.article_favicon {
    margin-right: 8px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar div.article_header >div.arrow_div {
    top: 1px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar.article_expanded > div.article_header {
    margin-left: 2px !important;
    padding-left: 8px !important;
}
#reader_pane.reader_pane_view_style_0 > div.ar:not(.article_expanded):hover,
#reader_pane.reader_pane_view_style_0 > div.ar.article_expanded > div.article_header:hover {
    box-shadow: 0 0 2px 2px #2E9AFE !important;
}
div.article_full_contents {
    padding-top: 5px !important;
}
div.article_full_contents > div.article_title {
    margin-top: 0 !important;
    margin-bottom: 0 !important;
}
div.article_full_contents > div.article_sub_title {
    margin-top: 8px !important;
}
div.article_full_contents > div.article_content {
    padding-top: 8px !important;
    padding-bottom: 8px !important;
}
div.article_full_contents > div.article_content > p:first-child {
    margin-top: 0 !important;
}
div.article_full_contents > div.article_content > p:last-child {
    margin-bottom: 0 !important;
}
div.article_full_contents > div.article_content a:visited {
    color: #554FCA !important;
}
div.pin_container {
    margin-left: auto;
    margin-right: auto;
    width: 100%;
}
div.article_full_contents {
    margin-left: auto;
    margin-right: auto;
    width: 90%;
}
div.ad_size_wide_skyscraper.sinner.side_sinner.border_sinner{
    border:0px;
    display: none;
    width:0px;
}
div#sinner_container{
    width:0px;
    height:0;
    overflow:hidden;
}
.graylink.ad_title.ad_title_centered{
    width:0;
    height:0;
}
.block_article_ad.leaderboard_ad.ad_size_leaderboard.sinner,.ad_title.ad_title_centered, .graylink.ad_title{
    width:0;
    height:0;
    overflow:hidden;
    margin:0;
    padding:0;
    border:0;
}
.block_article_ad.block_article_ad_bottom.leaderboard_ad.ad_size_large_rectangle.sinner{
    width:0;
    height:0;
    overflow:hidden;
    margin:0;
    padding:0;
    border:0;
}
.ad_size_large_rectangle.sinner.ad_everything_read{
    width:0;
    height:0;
    overflow:hidden;
    margin:0;
    padding:0;
    border:0;
}
.reader_pane_message{
    left:388;
}
}
